from collections import deque

class Solution:
    def minWindow(self, s: str, t: str) -> str:
        result = None
        t_dict = {}

        for pos, sym in enumerate(t):
            if sym in t_dict:
                t_dict[sym].append(-1)
            else:
                t_dict[sym] = deque([-1])

        for pos in range(len(s)):
            if s[pos] in t_dict:
                t_dict[s[pos]].popleft()
                t_dict[s[pos]].append(pos)

                for key in t_dict.keys():
                    if t_dict[key][0] == -1:
                        break
                else:
                    min_val = min([t_dict[key][0] for key in t_dict.keys()])
                    max_val = pos
                    substring = s[min_val:max_val + 1]

                    if result is None or len(substring) < len(result):
                        result = substring

        return "" if result is None else result


class TestSolution:
    def setup(self):
        self.sol = Solution()

    def test_empty(self):
        assert self.sol.minWindow("", "") == ""

    def test_one(self):
        assert self.sol.minWindow("A", "A") == "A"

    def test_notexist(self):
        assert self.sol.minWindow("B", "A") == ""

    def test_custom(self):
        assert self.sol.minWindow("ADOBECODEBANC", "ABC") == "BANC"

    def test_custom2(self):
        assert self.sol.minWindow("", "") == ""
